INSERT INTO `front_cms_programs` (`id`, `type`, `slug`, `url`, `title`, `date`, `event_start`, `event_end`, `event_venue`, `description`, `is_active`, `created_at`, `meta_title`, `meta_description`, `meta_keyword`, `feature_image`, `publish_date`, `publish`, `sidebar`) VALUES (1, 'events', 'summer-vacation', 'read/summer-vacation', 'Summer Vacation', NULL, '2023-05-03', '2023-05-30', '', 'Summer vacation is the best time of the year as it gives me a chance to relax and explore new things. It gives me an opportunity to take a break from my daily study routine and adopt new hobbies like gardening, dancing and painting, while also having fun with friends.', 'no', '2023-08-11 18:06:21', '', '', '', '', NULL, '0', NULL);
INSERT INTO `front_cms_programs` (`id`, `type`, `slug`, `url`, `title`, `date`, `event_start`, `event_end`, `event_venue`, `description`, `is_active`, `created_at`, `meta_title`, `meta_description`, `meta_keyword`, `feature_image`, `publish_date`, `publish`, `sidebar`) VALUES (2, 'events', 'sports-events', 'read/sports-events', 'Sports Events', NULL, '2023-01-16', '2023-01-20', 'School', 'Sports Events', 'no', '2023-08-11 18:07:18', '', '', '', '', NULL, '0', NULL);
INSERT INTO `front_cms_programs` (`id`, `type`, `slug`, `url`, `title`, `date`, `event_start`, `event_end`, `event_venue`, `description`, `is_active`, `created_at`, `meta_title`, `meta_description`, `meta_keyword`, `feature_image`, `publish_date`, `publish`, `sidebar`) VALUES (3, 'events', 'annual-function', 'read/annual-function', 'Annual Function', NULL, '2023-03-04', '2023-03-16', 'BK Castle', 'Annual function is the showcase of the entire year.It is the most awaited programme for all students and parents. The program is commenced by lighting of the ceremonial lamp by distinguished personages and the school principal.', 'no', '2023-08-11 18:09:09', '', '', '', '', NULL, '0', NULL);
INSERT INTO `front_cms_programs` (`id`, `type`, `slug`, `url`, `title`, `date`, `event_start`, `event_end`, `event_venue`, `description`, `is_active`, `created_at`, `meta_title`, `meta_description`, `meta_keyword`, `feature_image`, `publish_date`, `publish`, `sidebar`) VALUES (4, 'events', 'school-band-troupe', 'read/school-band-troupe', 'School Band Troupe', NULL, '2019-04-10', '2019-04-10', '', '<p open=\"\" style=\"line-height: 22px;\">MCRS hosts several competitions for fostering the talents and skills of students. The main competitions are as follows:</p>\r\n\r\n<h2 open=\"\" style=\"font-size: 20px; color: rgb(139, 22, 24); font-weight: lighter; margin: 5px 0px 10px;\">Literary Fest</h2>\r\n\r\n<p open=\"\" style=\"line-height: 22px;\">To develop the literary skills of students the Literary Fest is conducted every academic year. Competitions such as essay writing, debates, group discussions, elocutions and many more are conducted during the Literary Fest. Competitions are conducted for juniors and seniors house wise. ‘Literary Genius Award’ goes to the participant who has scored the top marks.<strong><em>&nbsp;‘</em></strong>Best House-Literary’- Rolling trophy presented to the house that scores the highest point in Literary Fest.</p>', 'no', '2023-08-11 18:10:22', '', '', '', '', NULL, '0', NULL);
INSERT INTO `front_cms_programs` (`id`, `type`, `slug`, `url`, `title`, `date`, `event_start`, `event_end`, `event_venue`, `description`, `is_active`, `created_at`, `meta_title`, `meta_description`, `meta_keyword`, `feature_image`, `publish_date`, `publish`, `sidebar`) VALUES (5, 'events', 'competitions', 'read/competitions', 'Competitions', NULL, '2019-04-10', '2019-04-10', '', '<p><span open=\"\">To develop the literary skills of students the Literary Fest is conducted every academic year. Competitions such as essay writing, debates, group discussions, elocutions and many more are conducted during the Literary Fest. Competitions are conducted for juniors and seniors house wise. ‘Literary Genius Award’ goes to the participant who has scored the top marks.</span><strong open=\"\"><em>&nbsp;‘</em></strong><span open=\"\">Best House-Literary’- Rolling trophy presented to the house that scores the highest point in Literary Fest.</span></p>\r\n\r\n<p><span open=\"\">Students get an opportunity to bring out the artist them. Competitions are held on various art forms, such as dance items, music, mime, fancy dress etc. Competitions are all conducted house wise. The ‘Kalathilakam’ and ‘Kalaprathibha’ awards are presented to the girl and boy participant respectively, who scores the top points for the Arts Fest.</span><strong open=\"\"><em>&nbsp;‘</em></strong><span open=\"\">Best House -Arts t’- Rolling trophy is presented to the house that scores the highest point in Arts Fest.</span></p>', 'no', '2023-08-11 18:11:16', '', '', '', '', NULL, '0', NULL);
