INSERT INTO `sms_template` (`id`, `title`, `message`, `created_at`) VALUES (1, 'National Republic Day', 'India celebrated its 73rd National Republic Day on the 26th of January, 2022. The constitution of India was adopted on the 26th of November, 1949 with Dr. B. R. Ambedkar as the Chairman of the Drafting Committee.', '2023-08-24');
INSERT INTO `sms_template` (`id`, `title`, `message`, `created_at`) VALUES (2, 'Sports Day Events', 'Games that are played on school sports days can be wide and varied. They can include straightforward sprints and longer races for all age groups as well as egg and spoon races.', '2023-08-24');
INSERT INTO `sms_template` (`id`, `title`, `message`, `created_at`) VALUES (3, 'Independence Day', 'I cordially invite you to the 76th independence day celebrations in our school on 15th August. The program will have cultural activities by our students and flag hoisting.', '2023-08-24');
INSERT INTO `sms_template` (`id`, `title`, `message`, `created_at`) VALUES (4, 'Online Classes', 'Be very punctual in log in time, screen off time, activity time table etc. Be ready with necessary text books, note books, pen, pencil and other accessories before class begins. Make sure the device is sufficiently charged before the beginning of the class.', '2023-08-24');
INSERT INTO `sms_template` (`id`, `title`, `message`, `created_at`) VALUES (5, 'International Day of Yoga', 'When proposing 21 June as the date, Modi said that the date was the longest day of the year in the northern hemisphere (shortest in the southern hemisphere), having special significance in many parts of the world.', '2023-08-24');


